INSERT INTO `Medals` VALUES (1,'Entourage','Vincent Chase ain\'t got nuthin on you! He only has three followers, you have 10!'),(2,'Crew','Gaining momentum, that\'s 50 followers and counting!'),(3,'Crowd','Is that a protest going on? Nope, just your crowd of 100 followers!'),(4,'Popular','Who said everyone wants to be like Mike! You\'ve got 250 followers!'),(5,'Celebrity','Perez needs to take notice, that is, with you and your 500 followers!'),(6,'Appeal','Suprise! Seeing your questions has the appeal of opening presents on Christmas Day! Well, sort of - that\'s 5 responses for 5 consecutive questions!'),(7,'Public Figure','You had a dream, that one day people would respond to your questions... and that time is now! That\'s 10 responses for 5 consecutive questions!'),(8,'Debater','Controversy, insight, humor - something you\'re asking is causing all this commotion and debate! That\'s 15 responses for 5 consecutive questions!'),(9,'Responder','Rest assured, we\'ve got a certified responder unit in our house! That\'s for responding to 25 questions within 24 hours!'),(10,'Rapid Fire','Arm your weapons! It\'s a space invasion of answers - responding to 25 questions within 60 minutes!'),(11,'Answer Fiend','Class, work, sleep... nothing stops your uncanny ability to respond! That\'s 25 questions within 15 minutes!'),(12,'Cowboy','Yiiihaaa! Your answers come as fast as a cowboy lassos his cattle. That\'s a response to a quesiton within a minute of posting!'),(13,'Volleyer','15-30-40... Game, point, and match! Your game is as swift and fast as your responses to 5 questions within a minute of posting!'),(14,'Slingshot','In Springfield, Bart would have marveled at your slingshot ability to respond. That\'s responding to 10 questions within a minute of posting!'),(15,'911 Dispatcher','All units dispatched and ready to answer... 10-4! There\'s nothing you can\'t respond to seeing as how you\'ve responded to 15 questions within a minute of posting!'),(16,'Nomad','Fill Me'),(17,'Traveler','Fill Me'),(18,'Jetsetter','Fill Me'),(19,'Worldly','Fill Me'),(20,'Focused','Mobile phone... check! Local knowledge... check! All the items to support your laser-like focus for asking and answering 20 questions in a day!'),(21,'Rapid','You\'ve channeled your inner-cheetah instincts, rapidly asking and answering 50 questions in a day!'),(22,'Realtime','Doc and Marty could not go back to the future in as fast a time as you ask and answer questions! That\'s 100 questions you\'ve asked or answered in a day!'),(23,'Arts Advisor','Answer 50 questions with 100 net likes in Arts'),(24,'Dating & Relationships Advisor','Answer 50 questions with 100 net likes in Dating & Relationships'),(25,'Food, Drink & Lifestyle Advisor','Answer 50 questions with 100 net likes in Food, Drink & Lifestyle'),(26,'Life & Society Advisor','Answer 50 questions with 100 net likes in Life & Society'),(27,'Local News & Events Advisor','Answer 50 questions with 100 net likes in Local News & Events'),(28,'Music & Performances Advisor','Answer 50 questions with 100 net likes in Music & Performances'),(29,'Night Life Advisor','Answer 50 questions with 100 net likes in Night Life'),(30,'Sports & Recreation Advisor','Answer 50 questions with 100 net likes in Sports & Recreation'),(31,'Traffic Advisor','Answer 50 questions with 100 net likes in Traffic'),(32,'Weather Advisor','Answer 50 questions with 100 net likes in Weather'),(33,'Expert Advisor','Congratulations, you\'ve been awarded the status of Expert Advisor for being an Advisor in 4 different categories!'),(34,'Jack Of All Trades','At this point, there\'s really nothing that you don\'t know and can\'t answer. Congratulations on obtaining Advisor medals in 8 different categories!'),(35,'Early Adopter','Here\'s a medal to thank you for adopting us when we were just beginning our journey!');
