--
-- Table structure for table `Users`
--

DROP TABLE IF EXISTS `Users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Users` (
  `userID` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Unique ID',
  `since` datetime NOT NULL COMMENT 'date of user creation',
  `facebookID` int(10) unsigned NOT NULL COMMENT 'user''s facebook ID',
  `twitterID` int(10) unsigned NOT NULL DEFAULT '0',
  `twitterSN` varchar(20) NOT NULL,
  `firstName` varchar(50) NOT NULL COMMENT 'First name',
  `lastName` varchar(50) NOT NULL COMMENT 'Last name',
  `email` varchar(50) NOT NULL COMMENT 'Email address',
  `picture` varchar(150) NOT NULL DEFAULT 'http://kuipp.com/profilepictures/default.png' COMMENT 'url to profile picture',
  `picX` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'picture x offset',
  `picY` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'picture y offset',
  `picZ` double unsigned NOT NULL DEFAULT '0.65' COMMENT 'picture zoom',
  `bio` varchar(150) NOT NULL,
  `latitude` decimal(11,8) NOT NULL DEFAULT '0.00000000' COMMENT 'last location',
  `longitude` decimal(11,8) NOT NULL DEFAULT '0.00000000' COMMENT 'last location',
  `location` varchar(50) NOT NULL DEFAULT 'Unknown' COMMENT 'Most Active City Name',
  `datetime` datetime NOT NULL COMMENT 'time of last location update',
  `level` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'User Gaming Level',
  `class` varchar(50) NOT NULL COMMENT 'User Gaming Class',
  `points` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'User Gaming Points',
  `coins` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'user''s coin count',
  `local` decimal(10,2) unsigned NOT NULL DEFAULT '10.00' COMMENT 'miles considered local',
  `recent` decimal(10,2) unsigned NOT NULL DEFAULT '168.00' COMMENT 'hours considered recent',
  `forward` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'Forward messages & directed questions to the user''s email',
  `visible` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Allow others to search for this user',
  `AMyQ` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Notify when someone answsers user''s question',
  `AFQ` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Notidy when someone answers a question user is following',
  `CMyA` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Notify when someone comments user''s answer',
  `FMe` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Notify when user gains a follower',
  `MMe` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Notify when user gets a message',
  `QMyI` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Notify when someone questions a user''s interest',
  `QAMe` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT 'Questions around Me',
  `QFQ` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'Notify when someone asks a question related to a question user is following',
  `Rmnd` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'Notify user when achievement opportunities arise',
  `numFollowing` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Following Counter',
  `numFollowers` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Follower Counter',
  `deviceToken` varchar(64) NOT NULL COMMENT 'device token of user''s device as of last login',
