DROP TABLE IF EXISTS `Comments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Comments` (
  `commentID` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Unique ID',
  `answerID` int(10) unsigned NOT NULL COMMENT 'Answer ID comment is attached to',
  `userID` int(10) unsigned NOT NULL COMMENT 'User ID of comment',
  `datetime` datetime NOT NULL COMMENT 'Datetime of comment',
  `comment` varchar(150) NOT NULL COMMENT 'Comment',
  `latitude` decimal(11,8) NOT NULL DEFAULT '0.00000000' COMMENT 'Latitude component of location',
  `longitude` decimal(11,8) NOT NULL DEFAULT '0.00000000' COMMENT 'Longitude component of location',
  `location` varchar(50) NOT NULL DEFAULT 'Unknown' COMMENT 'City Name',
  PRIMARY KEY (`commentID`),
  KEY `AnswerID` (`answerID`),
  KEY `UserID` (`userID`)
) ENGINE=MyISAM AUTO_INCREMENT=226 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

