DROP TABLE IF EXISTS `Events`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Events` (
  `eventID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `userID` int(10) unsigned NOT NULL,
  `type` tinyint(1) unsigned NOT NULL COMMENT '1=asked, 2=answered, 3=leveled, 4=earned Medal',
  `latitude` decimal(11,8) NOT NULL DEFAULT '0.00000000',
  `longitude` decimal(11,8) NOT NULL DEFAULT '0.00000000',
  `location` varchar(50) NOT NULL,
  `datetime` datetime NOT NULL COMMENT 'type 1&2 action location, type 3&4 last location',
  `info1` varchar(150) NOT NULL,
  `info2` varchar(150) NOT NULL,
  `picture` varchar(150) NOT NULL,
  `picX` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'x coordinate of top left corner',
  `picY` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'y coordinate of top left corner',
  `picZ` double unsigned NOT NULL DEFAULT '0.65' COMMENT 'zoom of picture',
  PRIMARY KEY (`eventID`)
) ENGINE=MyISAM AUTO_INCREMENT=1504 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

