  `messageID` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Unique ID',
  `chainID` int(10) unsigned NOT NULL COMMENT 'Chain ID',
  `toUser` int(10) unsigned NOT NULL COMMENT 'User ID Sent To',
  `fromUser` int(10) unsigned NOT NULL COMMENT 'User ID Sent From',
  `datetime` datetime NOT NULL COMMENT 'Date/Time Record',
  `message` varchar(150) NOT NULL COMMENT 'Message',
  `latitude` decimal(11,8) NOT NULL DEFAULT '0.00000000' COMMENT 'Latitude Component of Location',
  `longitude` decimal(11,8) NOT NULL DEFAULT '0.00000000' COMMENT 'Longitude Component of Location',
  `location` varchar(50) NOT NULL DEFAULT 'Unknown' COMMENT 'City Name',
  PRIMARY KEY (`messageID`),
  KEY `ChainID` (`chainID`),
  KEY `ToUser` (`toUser`),
  KEY `FromUser` (`fromUser`)
) ENGINE=MyISAM AUTO_INCREMENT=204 DEFAULT CHARSET=latin1;
