INSERT INTO `Messages` VALUES (1,1,3,1,'2011-05-17 18:36:58','Hi Lamar,\n\nThanks for signing up for Kuipp! Let me know if you have any questions\n\n-Chris','37.79355939','-122.40007250','San Francisco'),(2,2,3,5,'2011-05-17 20:25:15','Hi','0.00000000','0.00000000','(null)'),(3,3,7,2,'2011-05-17 21:42:16','Hi mom','36.75503814','-119.65702014','Fresno'),(4,3,2,7,'2011-05-17 21:53:02','I got it','0.00000000','0.00000000','(null)'),(5,4,7,6,'2011-05-17 22:37:58','How r u?','36.75498235','-119.65698453','Fresno'),(6,5,9,1,'2011-05-18 01:52:22','Shouldn\'t you be sleeping now?','37.78927515','-122.39109482','San Francisco'),(7,5,1,9,'2011-05-18 01:53:39','Haha, finishing up a presentation. Taking a break now. I\'m laughing at the person who asked you \"what is a soma\"\nThis version is so much faster!','47.62341910','-122.32156642','Seattle'),(8,5,9,1,'2011-05-18 01:57:47','Yea, that person that asked that is Brandon\'s dad! Haha thats something daddy would ask. Yup, there are still some bugs but this version is launchable','37.78927515','-122.39109482','San Francisco'),(9,5,1,9,'2011-05-18 02:01:15','Haha, his dad? Hilarious! Yeah, when i first downloaded it now, it froZe on me when I logged in. I deleted it and tried again and now it\'s fine.','47.62341910','-122.32156642','Seattle'),(10,5,9,1,'2011-05-18 02:03:40','That\'s good, haha there were some problems earlier today when we were testing it out since we were live on the app store since noon.','37.78927515','-122.39109482','San Francisco'),(11,5,1,9,'2011-05-18 02:06:05','You, Ryan, and Brandon are all following me now! Are u guys like all watching the downloads? Haha, I should go write a review!','47.62341910','-122.32156642','Seattle'),(12,5,9,1,'2011-05-18 02:33:40','Yes you should write a review!','37.78927515','-122.39109482','San Francisco'),(13,5,9,1,'2011-05-18 02:34:06','Were all up working on stuff right now','37.78927515','-122.39109482','San Francisco'),(14,6,14,1,'2011-05-18 12:49:23','Hey Michelle! 